function rightContainerJSON(t){$("#rightContainer .title .label").append(t.title),$("#rightContainer .title .count").append(" ("+t.items.length+")"),$(t.items).each(function(){var t;t="<article>",t+="   <h3>"+this.title+"</h3>",t+='   <p class="details">created on '+this.date+", at "+this.timestamp+' by <a href="#">'+this.user+"</a></p>",t+='   <p class="message">'+this.message+"</p>",t+="</article>",$(t).appendTo("#rightContainer .content")})}function getRightContainerData(t){$.ajax({dataType:"json",url:t+"/src/json/rightContainer.min.json",success:rightContainerJSON,error:function(){console.log("No right container JSON found.")},complete:function(){console.log("Right container JSON loaded.")}})}